export class Ride {
    constructor(id, offerId, name, car, seatsLeft, pickUp, destination) {
        this.id = id;
        this.offerId = offerId;
        this.name = name;
        this.car = car;
        this.seatsLeft = seatsLeft;
        this.pickUp = pickUp;
        this.destination = destination;
    }
}
